import React from "react";
import "./App.css";

function GetJson() {
  return [
    {
      id: 1,
      name: "test",
      age: 32,
    },
    {
      id: 2,
      name: "ed",
      age: 33,
    },
  ];
}

function App() {
  let data = GetJson();

  return (
    <div>
      {data.map((item) => {
        return (
          <div>
            <h3>Person:</h3>
            <ul key={item.id}>
              <li key={item.id}>{item.name}</li>
              <li key={item.id}>{item.age}</li>
            </ul>
          </div>
        );
      })}
    </div>
  );
}

export default App;
